import React from "react"

const Weather = (props) => {
    return(
        <div> 
            { props.city &&
                <div>
                    <p>Location: {props.city}, {props.country}</p>
                    <p>Temperature: {props.temp}</p>
                    <p>Rressure: {props.pressure}</p>
                    <p>Sunrise: {props.sunrise}</p>
                    <p>Sunset: {props.sunset}</p>
                </div>
            }
            <p>{props.error}</p>
        </div>
    );
}

export default Weather;
